description:
Empresa com 92 anos de Experiencia. Com o objetivo de trazer conforto, bem estar e qualidade de vida a todos os que precisam. VIVA SEM DOR E COM CONFORTO.
Especializada em:
- Palmilhas Individualizadas Feitas a Medida;
- Calcado Ortopedico Feito a Medida;
- Calcado Especial para Pes Sensiveis e Especiais;
- Meias Elasticas e de Descanso;
- Calcado para Diabeticos;
- Calcado de Conforto;
- Cacado Profissional;
- Palmilhas Ortopedicas;
- Palmilhas Posturais;
- Palmilhas de Conforto Individualizadas;
- Material de Quarto e Descanso;
- Material de Mobilidade e Dia a Dia;
- Higiene e Banho.

Compromisso na excelencia de cuidados de saude prestados aos nossos clientes
Dispomos dos mais variados servicos, que vao de encontro as necessidades de cada utente. Damos o conforto e apoio necessario num ambiente acolhedor e funcional.

Seguranca e conforto do paciente;
Servicos de apoio e de medicina especializada;
Especialidades nas mais diversas areas;
O melhor atendimento e apoio ao doente;
Atendimento permanente;

Ortopedia onde pode encontrar Tudo para Cuidar do seu Familiar desde
Ajudas no Quarto, Conforto e Bem-Estar - Cama Articulada, Colchoes, Mesas de Apoio e Poltrona;
Ajudas na Mobilidade - Cadeira de Rodas, Andarilho, Scooters, Canadianas , Ponteiras, Palmilhas, Rampas de Aluminio e Elevador de Escadas;
Ajudas WC/ Banho - Cadeira Banho Giratoria, Prancha de Banheira , Barras de Apoio Rebativel, Alteador Sanita e Quadro Sanita;
Ajudas Uteis/ Diaria - Medidor Tensao, Oximetro Dedo, Meias Compressao , Urinol, Arrastadeira, Fraldas, Pensos, Toalhitas, Creme, Gel de Banho, Copo Acamados e Caixa Medicacao;
Material Clinico / Produtos Saude - Compressas, Algalias, Aquacel AG, Adesivo Omnifix, Seringas de Alimentacao.

O Madeira Medical Center esta localizado no centro do Funchal (junto ao Mercado dos Lavradores), que disponibiliza um conjunto de servicos como:
- Atendimento Medico Nao Programado Adultos;
- Consultas Medicas de diversas especialidades;
- Exames de Imagiologia (Ressonancia, TAC, Ecografia, Raio-X, Eco Doppler);
- Gastrenterologia (Endoscopia e Colonoscopia);
- Cardiologia (ECG, Ecocardiograma, Holter, Mapa, Prova de Esforco);
- Audiologia;
- Analises Clinicas;
- Servico de Enfermagem;
- Fisioterapia
Estamos consigo em todos os momentos, no centro da cidade do Funchal.

Loja de Produtos Ortopedicos:
- Produtos de Apoio;
- Ortoteses;
- Meias Elasticas e de Descanso;
- Palmilhas por Medida;
- Aconselhamento Tecnico.

Na Spiralis Health Concept pode contar com:

 - Uma Profissional Certificada;
- Um Atendimento Individualizado;
- A melhor alternativa Natural;
- Uma solucao SEM farmacos nem efeitos secundarios.
